import Home from "./components/patient/Home";
 
const App = () =>{

    return (       
        <div className="Chatbot">


            <Button to ="" />
            <Button to ="records" />

              <Routes>
              <Route path ="/" element={<Home />} />
              <Route path = "/records" element={<RecordView />} />
